function About() {
    const skills = ["JavaScript", "React", "Node.js", "Bootstrap", "MongoDB"];

    return (
        <div className="container mt-5">
            <h1>About Me</h1>
            <p>I am a passionate web developer with expertise in front-end and back-end technologies.</p>
            
            <h3 className="mt-4">Technical Skills</h3>
            <ul className="list-group mt-3">
                {skills.map((skill, index) => (
                    <li key={index} className="list-group-item">
                        <i className="bi bi-check-circle text-success me-2"></i> {skill}
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default About;
